import "../assets/styles/ProductTemp.css";
const ProductTemp= ({ image, name,  price,discount }:{ image:any, name:any,  price:any,discount:any }) => {
    return (
      <div className="col-sx-4 product">
        <div className="col-sx-1 product-image">
          <img src={image} alt={name} height="150" />
        </div>
        <div className="col-sx-2 product-detail">
          <h4>{name}</h4>
        </div>
        <div className="col-sx-4 product-price">
         <span>{price} </span>
          {discount >0 && <span className="discount align-items-right">{discount}%</span>}
        </div>
      </div>
    );
  }
  export default ProductTemp;
